import React from 'react'
import './Climat.css'
const Climat = () => {
  return (
    <div>
      <div className="Climat">
        <div className="mbox">
          <div className="song"></div>
          <div className="temparature"></div>
        </div>
        
        <div className="mount"></div>
      </div>
    </div>
  );
}

export default Climat
